import { useState, useMemo, useRef, useEffect } from "react";
// import { Circle } from "@react-google-maps/api";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faXmark,
  faStar,
  faStarHalfStroke,
} from "@fortawesome/free-solid-svg-icons";

import {
  APIProvider,
  Map,
  useMap,
  Marker,
  AdvancedMarker,
} from "@vis.gl/react-google-maps";

import { MarkerClusterer } from "@googlemaps/markerclusterer";

import SearchFilters from "./SearchFilters";
import Spots from "./Spots";
import SearchBar from "./SearchBar";
import { blueBallIcon } from "./mapStyles.js";

export default function GoogleMap() {
  const [location, setLocation] = useState("");
  const [sliderValue, setSliderValue] = useState(15);
  const [spotValue, setSpotValue] = useState("Restaurant");
  const [searchResults, setSearchResults] = useState([]);
  const center = useMemo(() => ({ lat: 51.103574, lng: 16.943842 }), []);
  const options = useMemo(
    () => ({
      mapId: "b181cac70f27f5e6",
      disableDefaultUI: true,
      clickableIcons: false,
    }),
    []
  );

  const handleSearch = () => {
    const data = {
      keyword: spotValue,
      location: {
        lat: location.lat,
        lng: location.lng,
      },
      radius: sliderValue,
    };

    const searchFilters = document.querySelector(".search-filters");
    if (searchFilters) {
      searchFilters.style.marginTop = "0dvh";
    }

    fetch("/api/search", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(data),
    })
      .then((response) => response.json())
      .then((result) => {
        console.log("Success:", result.googleData.results);
        setSearchResults(result.googleData.results);
      })
      .catch((error) => {
        console.error("Error:", error);
      });
  };

  const Markers = ({ points }) => {
    const map = useMap();
    const [markers, setMarkers] = useState({});
    const clusterer = useRef(null);

    useEffect(() => {
      if (!map) return;
      if (!clusterer.current) {
        clusterer.current = new MarkerClusterer({ map });
      }
    }, [map]);

    useEffect(() => {
      if (clusterer.current && markers) {
        clusterer.current.clearMarkers();
        clusterer.current.addMarkers(Object.values(markers));
      }
    }, [markers]);

    const setMarkerRef = (marker, key) => {
      if (marker && markers[key]) return;
      if (!marker && !markers[key]) return;

      setMarkers((prev) => {
        if (marker) {
          return { ...prev, [key]: marker };
        } else {
          const newMarkers = { ...prev };
          delete newMarkers[key];
          return newMarkers;
        }
      });
    };

    return searchResults.map((result) => (
      <AdvancedMarker
        key={result.place_id}
        position={result.geometry.location}
        ref={(marker) => setMarkerRef(marker, result.place_id)}
      >
        <div className="custom-marker-wrapper">
          <div className="test">
            <div className="custom-marker">
              {result.rating} ({result.user_ratings_total})
            </div>
          </div>
          <div className="custom-marker-label">{result.name}</div>
        </div>
      </AdvancedMarker>
    ));
  };

  return (
    <>
      <APIProvider apiKey={process.env.React_App_Api_Key}>
        <div className="container">
          <SearchBar />
          <div className="map-container">
            <div className="map">
              <Map
                defaultZoom={10}
                defaultCenter={center}
                options={options}
                mapContainerClassName="map-container2"
              >
                {location && (
                  <>
                    {/* <Circle center={location} radius={sliderValue * 100} /> */}
                    <Marker
                      position={location}
                      icon={{
                        url: blueBallIcon,
                      }}
                    />
                  </>
                )}
                {searchResults && <Markers points={searchResults} />}
              </Map>
            </div>
            <div className="map-results">
              <div className="map-results-header">
                <h2>Results</h2>
                <button className="map-results-btn">
                  <FontAwesomeIcon icon={faXmark} className="icon" />
                </button>
              </div>
              <div className="map-results-elements">
                <div className="map-result">
                  <p>Happy Moon's Kadikoy</p>
                  <p>
                    4.5 <FontAwesomeIcon icon={faStar} />{" "}
                    <FontAwesomeIcon icon={faStar} />{" "}
                    <FontAwesomeIcon icon={faStar} />{" "}
                    <FontAwesomeIcon icon={faStarHalfStroke} />
                  </p>
                </div>
              </div>
            </div>
          </div>
          <Spots />
        </div>
        <SearchFilters
          location={location}
          setLocation={setLocation}
          sliderValue={sliderValue}
          setSliderValue={setSliderValue}
          spotValue={spotValue}
          setSpotValue={setSpotValue}
          handleSearch={handleSearch}
        />
      </APIProvider>
    </>
  );
}
